description:
The Crazy Chickens are back and this time they are disguised as pirates, not only hiding on an idyllic island, but looking for treasure. Your treasure!
Bring your shotgun, your cannon and your targeting skills to make these pesky pirate chickens feel the wrath of a true pirate.

They will not go down without a fight and have again prepared various riddles and tricks which you have to unveil for the perfect score. The best pirate hunters might even get a chance to fight the chicken pirates with their own weapons during an epic naval battle.

